const URL = "http://localhost:8000/api";

const post = (url, body) =>
  fetch(`${URL}/${url}`, {
    method: "POST",
    body,
  });

export const sendDetails = async (form) => {
  const response = await post("forms/", form);
  const data = await response.json();
  console.log(data, "data");
};
